import logo from './waffle_logo.svg';
import './App.css';
import MenuBox from './components/MenuBox';

function App() {



  return (
    <div className="Wrap">
      <div className="Head">
        <img className="Logo" src={logo} alt="Logo" />
        <h1>와플스튜디오 메뉴 관리</h1>
      </div>
      <div className='Search'>
        <span className='Searchst'> 이름 검색:</span>
        <div className='Searchmerge'>
          <input id="SearchInput" placeholder="검색어 입력"></input>
          <img className='Searchicon' src="https://s3.ap-northeast-2.amazonaws.com/cdn.wecode.co.kr/icon/search.png" alt={logo} />
        </div>
      </div>
      <MenuBox></MenuBox>
    </div>



  );
}

export default App;
